import React, { useState } from 'react';
import {
  Button,
  Card,
  CardContent,
  Typography,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  CircularProgress,
  Box,
  Alert,
  Collapse,
  IconButton,
  styled,
} from '@mui/material';
import {
  CheckCircle as CheckIcon,
  Error as ErrorIcon,
  Refresh as RefreshIcon,
  ExpandMore as ExpandIcon,
} from '@mui/icons-material';
import { runNetworkDiagnostics } from '../tests/ChatConnection.test';

const StyledCard = styled(Card)(({ theme }) => ({
  backgroundColor: theme.palette.background.paper,
  backgroundImage: 'none',
  border: `1px solid ${theme.palette.divider}`,
  '& .MuiCardContent-root': {
    padding: theme.spacing(2),
  },
}));

const StatusList = styled(List)(({ theme }) => ({
  '& .MuiListItem-root': {
    padding: theme.spacing(0.5, 0),
  },
}));

const DetailsList = styled(List)(({ theme }) => ({
  '& .MuiListItem-root': {
    padding: theme.spacing(0.5, 0),
  },
  '& .MuiListItemText-secondary': {
    color: theme.palette.text.secondary,
  },
}));

const ExpandButton = styled(IconButton)(({ theme, expanded }) => ({
  transform: expanded ? 'rotate(180deg)' : 'rotate(0deg)',
  transition: theme.transitions.create('transform', {
    duration: theme.transitions.duration.shortest,
  }),
}));

const NetworkDiagnostics = () => {
  const [loading, setLoading] = useState(false);
  const [diagnostics, setDiagnostics] = useState(null);
  const [expanded, setExpanded] = useState(false);

  const runTests = async () => {
    setLoading(true);
    try {
      const results = await runNetworkDiagnostics();
      setDiagnostics(results);
      setExpanded(true); // Auto-expand on new results
    } catch (error) {
      console.error('Failed to run diagnostics:', error);
    } finally {
      setLoading(false);
    }
  };

  return (
    <StyledCard>
      <CardContent>
        <Box display="flex" justifyContent="space-between" alignItems="center">
          <Box display="flex" alignItems="center" gap={1}>
            <Typography variant="subtitle1" component="div" sx={{ fontWeight: 500 }}>
              LM Studio Status
            </Typography>
            {diagnostics && (
              <ExpandButton
                size="small"
                onClick={() => setExpanded(!expanded)}
                expanded={expanded}
              >
                <ExpandIcon />
              </ExpandButton>
            )}
          </Box>
          <Button
            variant="contained"
            startIcon={loading ? <CircularProgress size={16} /> : <RefreshIcon />}
            onClick={runTests}
            disabled={loading}
            size="small"
          >
            {loading ? 'Testing...' : 'Test Connection'}
          </Button>
        </Box>

        <Collapse in={expanded}>
          {diagnostics && (
            <Box mt={2}>
              <StatusList>
                <ListItem>
                  <ListItemIcon>
                    {diagnostics.serverReachable ? (
                      <CheckIcon color="success" />
                    ) : (
                      <ErrorIcon color="error" />
                    )}
                  </ListItemIcon>
                  <ListItemText 
                    primary="Server Connection"
                    secondary={diagnostics.serverReachable ? 'Connected' : 'Not Connected'}
                  />
                </ListItem>

                {Object.entries(diagnostics.endpoints).map(([endpoint, status]) => (
                  <ListItem key={endpoint}>
                    <ListItemIcon>
                      {status ? (
                        <CheckIcon color="success" />
                      ) : (
                        <ErrorIcon color="error" />
                      )}
                    </ListItemIcon>
                    <ListItemText 
                      primary={`${endpoint.charAt(0).toUpperCase() + endpoint.slice(1)} Endpoint`}
                      secondary={status ? 'Available' : 'Not Available'}
                    />
                  </ListItem>
                ))}
              </StatusList>

              {diagnostics.modelList.length > 0 && (
                <Box mt={2}>
                  <Typography variant="subtitle2" gutterBottom color="textSecondary">
                    Available Models
                  </Typography>
                  <DetailsList>
                    {diagnostics.modelList.map((model) => (
                      <ListItem key={model.id}>
                        <ListItemText 
                          primary={model.id}
                          secondary={`Type: ${model.object}`}
                        />
                      </ListItem>
                    ))}
                  </DetailsList>
                </Box>
              )}

              {diagnostics.details.length > 0 && (
                <Box mt={2}>
                  <Typography variant="subtitle2" gutterBottom color="textSecondary">
                    Details
                  </Typography>
                  <DetailsList>
                    {diagnostics.details.map((detail, index) => (
                      <ListItem key={index}>
                        <ListItemText secondary={detail} />
                      </ListItem>
                    ))}
                  </DetailsList>
                </Box>
              )}

              {diagnostics.errors.length > 0 && (
                <Box mt={2}>
                  <Alert 
                    severity="error"
                    sx={{ 
                      backgroundColor: 'rgba(211, 47, 47, 0.1)',
                      color: '#ff4444',
                    }}
                  >
                    <Typography variant="subtitle2">Errors</Typography>
                    <DetailsList>
                      {diagnostics.errors.map((error, index) => (
                        <ListItem key={index}>
                          <ListItemText secondary={error} />
                        </ListItem>
                      ))}
                    </DetailsList>
                  </Alert>
                </Box>
              )}
            </Box>
          )}
        </Collapse>
      </CardContent>
    </StyledCard>
  );
};

export default NetworkDiagnostics;
